import "./App.css";
import "./index.css";
import Header from "./components/Header";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="App">
      <Header />
      <main className="content">
        <h1 className="text-2xl font-bold text-center">
          Bienvenue sur StreamingList
        </h1>
      </main>
      <Footer />
    </div>
  );
}

export default App;
